import React, { useState } from 'react';
import Webcam from 'react-webcam';
import axios from 'axios';

const Ashu = () => {
  const [image, setImage] = useState(null);  // Store the captured image
  const [ingredients, setIngredients] = useState([]);
  const [probabilities, setProbabilities] = useState([]);
  const [mass, setMass] = useState(100);  // Default mass value
  const [nutritionInfo, setNutritionInfo] = useState(null);
  const [capturing, setCapturing] = useState(false);

  const webcamRef = React.useRef(null);

  // Capture image from the webcam
  const captureImage = () => {
    const imageSrc = webcamRef.current.getScreenshot();  // Get base64 image string
    console.log("Captured image data: ", imageSrc);  // Debugging log to print the image data
    setImage(imageSrc);  // Store the captured image in the state
    setCapturing(true);  // Set capturing state to true
  };

  const handleMassChange = (e) => {
    setMass(e.target.value);  // Update the mass value when the user changes it
  };

  // Handle base64 image to send to backend for prediction
  const predict = async () => {
    if (!image) {
      console.error("No image captured.");
      return;
    }
  
    console.log("Sending image and mass data to backend...");
    console.log("Mass: ", mass);
    console.log("Image Data (Base64 - first 100 characters): ", image.slice(0, 100));  // Log first 100 characters
  
    try {
      const response = await axios.post('http://localhost:5001/predict', {
        image: image,  // Send the base64 image to the backend
        mass: mass     // Send the mass value along with the image
      });
  
      console.log("Prediction Response: ", response.data);  // Debugging log to print backend response
  
      setIngredients(response.data.ingredients);
      setProbabilities(response.data.probabilities);
      setNutritionInfo(response.data.nutrition);
    } catch (error) {
      console.error("Error in prediction:", error);
    }
  };
  

  return (
    <div className="App">
      <h1 className="header">Food Nutrient Prediction</h1>

      {/* Display webcam or captured image */}
      {capturing ? (
        <>
          <div className="image-container">
            <img src={image} alt="Captured" className="captured-image" />
          </div>
          <div className="input-container">
            <label>Mass (grams):</label>
            <input 
              type="number" 
              value={mass} 
              onChange={handleMassChange}  // Handle mass change
              className="input-field"
            />
            <button className="button" onClick={predict}>Predict Nutrition and Ingredients</button>
          </div>
          <div className="nutrition-info">
            {nutritionInfo && (
              <div>
                <h3>Nutrition Info:</h3>
                <p>Protein: {nutritionInfo.protein}</p>
                <p>Fat: {nutritionInfo.fat}</p>
                <p>Carbs: {nutritionInfo.carbs}</p>
                <p>Calories: {nutritionInfo.calories}</p>
              </div>
            )}
          </div>
        </>
      ) : (
        <div className="webcam-container">
          <Webcam
            audio={false}
            ref={webcamRef}
            screenshotFormat="image/jpeg"
            width="100%"
            videoConstraints={{
              facingMode: "environment"
            }}
          />
        </div>
      )}

      {/* Buttons to capture image and predict */}
      <button className="button capture-btn" onClick={captureImage}>Capture Image</button>
      <button className="button" onClick={predict}>Predict Ingredients and Nutrition</button>

      {/* Display predicted ingredients */}
      <div className="ingredients-container">
        {ingredients.length > 0 ? (
          <ul className="ingredients-list">
            {ingredients.map((ingredient, index) => (
              <li key={index} className="ingredient-item">
                {ingredient}: {probabilities[index].toFixed(2)}% {/* Display probability as percentage */}
              </li>
            ))}
          </ul>
        ) : (
          <p>No ingredients predicted yet.</p>
        )}
      </div>

      {/* Allow the user to capture another image */}
      <button className="button" onClick={() => setCapturing(false)}>Capture New Image</button>
    </div>
  );
};

export default Ashu;
